def findTheLongestSubstring(s: str) -> int:
    # 给定字符串 s，返回包含每个元音偶数次的最长子字符串的大小
    # 也就是说，‘a’、‘e’、‘i’、‘o’和 ‘u’必须出现偶数次

    longestResult = 0

    lenStr = len(s)
    vowelStr = "aeiou"

    vowelList=[]
    posList=[]

    for pos in range(lenStr):
        letter = s[pos]
        if letter in vowelStr:
            vowelList.append(letter)
            posList.append(pos)

    lenVowel = len(vowelList)

    if lenVowel == 0:  # 没有 元音
        return lenStr

    if lenStr == 1:  # 长度不够
        return 1 - lenVowel  # 如果 是元音

    if lenVowel != 0:  # 有元音
        leftMargin = (posList[0]-1)-0+1
        rightMargin = (lenStr-1) - (posList[-1]+1) + 1
        longestResult = max(leftMargin, longestResult, rightMargin)
    else:  # 没元音
        return lenStr

    preVowelCntList = getPreVowelCntList(vowelList, lenVowel)

    for i in range(0, lenVowel-1):
        for j in range(i+1, lenVowel):
            # 统计时 包含 i, j 位置上的 vowel

            if ((j-i + 1) % 2) != 0:  # 元音总和非偶数，排除当前可能
                continue

            leftVowelCnt = preVowelCntList[i]
            rightVowelCnt = preVowelCntList[j+1]  # 不用担心 j 越界

            # deltaVowel = rightVowelCnt - leftVowelCnt
            deltaVowel = [r-l for r,l in zip(rightVowelCnt, leftVowelCnt)]

            if all(cnt % 2 == 0 for cnt in deltaVowel):
                if i == 0:  # 第一个元音
                    leftPos = 0
                else:  # 不是第一个元音
                    leftPos = posList[i-1]+1

                if j == (lenVowel - 1):  # 最后一个元音
                    rightPos = lenStr - 1
                else:  # 不是最后一个元音
                    rightPos = posList[j+1]-1

                tempLength = rightPos - leftPos + 1

                if tempLength > longestResult:
                    longestResult = tempLength

            marginBetweenVowel = (posList[j]-1) - (posList[i]+1) + 1
            if marginBetweenVowel > longestResult:
                longestResult = marginBetweenVowel

    return longestResult

def getPreVowelCntList(vowelList, lenVowel):
    # preVowelCntList[ptr] 代表 ptr 位之前的(不包含ptr) vowl 数量统计
    preVowelCntList = [[0,0,0,0,0]]

    tempVowelCntList = [0,0,0,0,0]

    letterPosDict = {   'a':0,
                        'e':1,
                        'i':2,
                        'o':3,
                        'u':4, }

    for i in range(lenVowel):
        letter = vowelList[i]
        tempVowelCntList[letterPosDict[letter]] += 1

        preVowelCntList.append(tempVowelCntList.copy())

    return preVowelCntList


if __name__ == '__main__':
    s = ""
    result = findTheLongestSubstring(s)
    print(result)

